('375410', 'Fauteuil acoustique connecté, revêtement au choix. L 100cm HAssise 44cm H176cm', '{\\rtf1\\ansi\\ansicpg1252\\deff0\\deflang1036{\\fonttbl{\\f0\\fswiss\\fcharset0 TradeGothic-Light;}{\\f1\\fnil\\fcharset0 Microsoft Sans Serif;}}\r\n\\viewkind4\\uc1\\pard\\f0\\fs16 Le design de ce fauteuil est unique de par ses formes douces et futuristiques. Il se r\\\'e9sume \\\'e0 une pause au cours de votre journ\\\'e9e charg\\\'e9e. Lorsque vous prenez place dans, vous \\\'eates prot\\\'e9g\\\'e9 du bruit et des activit\\\'e9s vous entourant.  Un lieu dans lequel on peut \\\'eatre tranquille pour une courte dur\\\'e9e / qui se pr\\\'e9sente dans un design agr\\\'e9able / qui est mobile / dans lequel il est possible de brancher et charger smartphones ou tablettes / et o\\\'f9 l\\rquote on peut se reposer, travailler, lire, \\\'e9couter, parler\\\'85\\par\r\n\\par\r\nLe mod\\\'e8le est transportable au moyen des 8 roulettes qui freinent lors du chargement. \\\'c9quip\\\'e9 de 3 lampes DEL d\\rquote 1 W avec r\\\'e9gulation de l\\rquote intensit\\\'e9, 2 haut-parleurs de 5 W, une batterie de 12 V avec chargeur 220 V, chargeur USB, syst\\\'e8me Bluetooth et panneau de contr\\\'f4le.\\par\r\n\\par\r\nImportant : Une ouverture de porte de 92 cm au minimum est requise pour qu\'il puisse passer mont\\\'e9 en entier ! Si l\\rquote ouverture de porte est plus petite, le meuble peut \\\'eatre livr\\\'e9 d\\\'e9mont\\\'e9 et remont\\\'e9 sur place!\\par\r\n\\b GARANTIE 6 ANS.\\b0\\f1\\fs17\\par\r\n}\r\n', NULL),
